import React from "react";
import {ContentList} from './contentStyles';

function Content() {
    fetch('https://604048b4f34cf600173c7cda.mockapi.io/api/v1/list-artisan')
    .then((response) => response.json())
    .then((findresponse) => {
        console.log(findresponse.name)
        this.setState({
            data:findresponse.name,
        })
         
    })
    .catch((error) => {
      console.error(error);
    });
   return (
    <div>
    {this.state.data.name} 
  </div> 
